import React, { useState } from "react";
import { Button } from "../../components/ui/button";
import { Input } from "../../components/ui/input";
import { Search } from "lucide-react";

function Admin() {
  const [searchTerm, setSearchTerm] = useState("");

  const handleSearchChange = (e) => {
    setSearchTerm(e.target.value);
  };

  const handleSearch = () => {
    console.log("Searching for:", searchTerm);
    // Aqui você pode implementar a lógica de pesquisa futuramente
  };

  return (
    <div className="p-4 grid gap-6">
      <div className="bg-white shadow-md rounded-lg p-6">
        <div className="flex flex-col gap-4">
          <h1 className="text-xl font-bold">Admin de Projetos</h1>

          {/* Botões das funcionalidades */}
          <div className="flex gap-4">
            <Button className="bg-blue-500 text-white hover:bg-blue-600">Adicionar Novo Projeto</Button>
            <Button className="bg-yellow-500 text-white hover:bg-yellow-600">Editar Projeto</Button>
            <Button className="bg-red-500 text-white hover:bg-red-600">Listar/Excluir Projetos</Button>
          </div>

          {/* Barra de pesquisa */}
          <div className="flex items-center gap-2 mt-4">
            <Input
              type="text"
              placeholder="Pesquise um projeto"
              value={searchTerm}
              onChange={handleSearchChange}
              className="flex-grow"
            />
            <Button
              className="bg-gray-500 text-white hover:bg-gray-600 flex items-center gap-2"
              onClick={handleSearch}
            >
              <Search className="w-4 h-4" /> Pesquisar
            </Button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Admin;
